import React from 'react'
import { Modal } from '../UI/Modal'
import { CartItem } from './CartItem'

export const Cart = () => {
  return (
    <Modal>
        <CartList>
        <CartItem/>
        </CartList>
        
    </Modal>
  )
}

const CartList = styled('ul')`
	list-style: none;
	display: flex;
	flex-direction: column;
	max-height: 360px;
	overflow-y: scroll;
`
